import React from 'react';
import Navbar from './Navbar';

const images = [
    { src: require('../images/apexlegends.png'), title: 'Apex Legends', link: '/guides/apexlegends' },
    { src: require('../images/callofdutywarzone.png'), title: 'Call of Duty: Warzone', link: '/guides/cod-warzone' },
    { src: require('../images/counterstrike2.png'), title: 'Counter-Strike 2', link: '/guides/counter-strike-2' },
    { src: require('../images/fortnite.png'), title: 'Fortnite', link: '/guides/fortnite' },
    { src: require('../images/leagueoflegends.png'), title: 'League of Legends', link: '/guides/league-of-legends' },
    { src: require('../images/overwatch2.png'), title: 'Overwatch 2', link: '/guides/overwatch-2' },
    { src: require('../images/rainbowsixsiege.png'), title: 'Rainbow Six Siege', link: '/guides/rainbow-six-siege' },
    { src: require('../images/rocketleague.png'), title: 'Rocket League', link: '/guides/rocket-league' },
    { src: require('../images/valorant.png'), title: 'Valorant', link: '/guides/valorant' },
];

const Guideslist = () => {
    return (
        <div>
            <Navbar />
            <div className="guides-list">
                {images.map((image, index) => (
                    <a key={index} href={image.link} className="guide-item">
                        <div className="overlay-container">
                            <img className="grayscale" src={image.src} alt={image.title} />
                            <div className="overlay">
                                <h3>{image.title}</h3>
                            </div>
                        </div>
                        <p>{image.title}</p>
                    </a>
                ))}
            </div>
        </div>
    );
};

export default Guideslist;
